import React, { useState } from 'react';
import * as XLSX from 'xlsx';

const FeesPage = () => {
  const [rollNumber, setRollNumber] = useState('');
  const [student, setStudent] = useState(null);
  const [error, setError] = useState('');

  const handleSearch = async () => {
    setError('');
    setStudent(null);

    try {
      const response = await fetch('/fees.xlsx');
      const data = await response.arrayBuffer();
      const workbook = XLSX.read(data, { type: 'array' });
      const sheet = workbook.Sheets[workbook.SheetNames[0]];
      const rows = XLSX.utils.sheet_to_json(sheet);

      const match = rows.find(row => String(row.RollNumber).trim() === rollNumber.trim());

      if (match) {
        setStudent(match);
      } else {
        setError('Roll number not found.');
      }
    } catch (err) {
      console.error(err);
      setError('Failed to load fee file.');
    }
  };

  const getDueAmount = () => {
    const total = Number(student?.TuitionFee || 0);
    const paid = Number(student?.PaidAmount || 0);
    return total - paid;
  };

  const isFullyPaid = () => getDueAmount() <= 0;

  return (
    <div style={pageStyle}>
      <h1 style={titleStyle}>üí≥ Fee Status</h1>

      <div style={inputBlock}>
        <input
          type="text"
          placeholder="Enter Roll Number"
          value={rollNumber}
          onChange={(e) => setRollNumber(e.target.value)}
          style={inputStyle}
        />
        <button onClick={handleSearch} style={buttonStyle}>Check Fees</button>
      </div>

      {error && <p style={{ color: 'red', textAlign: 'center' }}>{error}</p>}

      {student && (
        <div style={cardStyle}>
          <h3>{student.Name}</h3>
          <table style={tableStyle}>
            <tbody>
              <tr>
                <td><strong>Tuition Fee</strong></td>
                <td>‚Çπ{student.TuitionFee}</td>
              </tr>
              <tr>
                <td><strong>Amount Paid</strong></td>
                <td>‚Çπ{student.PaidAmount}</td>
              </tr>
              <tr>
                <td><strong>Remaining Due</strong></td>
                <td>‚Çπ{getDueAmount()}</td>
              </tr>
              <tr>
                <td><strong>Status</strong></td>
                <td style={{ color: isFullyPaid() ? 'green' : 'red' }}>
                  {isFullyPaid() ? '‚úÖ Paid' : '‚ùå Due'}
                </td>
              </tr>
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

// Styles
const pageStyle = {
  padding: '40px',
  fontFamily: 'Segoe UI, sans-serif',
  backgroundColor: '#f7f9fc',
  minHeight: '100vh',
};

const titleStyle = {
  fontSize: '2rem',
  textAlign: 'center',
  marginBottom: '30px',
  color: '#2c3e50',
};

const inputBlock = {
  display: 'flex',
  justifyContent: 'center',
  gap: '15px',
  marginBottom: '30px',
};

const inputStyle = {
  padding: '10px',
  borderRadius: '6px',
  border: '1px solid #ccc',
  fontSize: '1rem',
  width: '250px',
};

const buttonStyle = {
  padding: '10px 20px',
  backgroundColor: '#007bff',
  color: '#fff',
  border: 'none',
  borderRadius: '6px',
  cursor: 'pointer',
};

const cardStyle = {
  backgroundColor: '#fff',
  padding: '20px',
  maxWidth: '500px',
  margin: '0 auto',
  borderRadius: '10px',
  boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
};

const tableStyle = {
  width: '100%',
  marginTop: '20px',
  borderCollapse: 'collapse',
  lineHeight: '1.8',
};

export default FeesPage;
